ISLAMABAD, Sep 8 (APP): Ambassador of Ethiopia to Pakistan Jemal Bekerl Friday called on Caretaker Foreign Minister Jalil Abbas Jilani at Ministry of Foreign Affairs here.
During the meeting, wide range of bilateral and regional topics came under discussion. They agreed to enhance bilateral and multilateral cooperation especially in fields of trade, investment and cultural exchanges.
